message:
Informações muito importantes sobre The Storm Rider. Amplia a detenção do vice-presidente da União Europeia (socialista grego) por aceitar propina do Catar, e antecipa que há outros socialistas investigados. Ele afirma que há muitos outros líderes europeus na lista do partido comunista chinês, e que todas essas informações converterão a UE em uma batalha campal, que se somará às informações sobre as vacinas, e que levará à queda de governos. Essa lacuna de informação prejudicial é a razão pela qual a União Europeia vai tentar censurar o Twitter e atacar a teoria da conspiração. Por outro lado, The Storm Rider confirma que a Apple mudou de lado. A razão é que os militares têm informações difíceis contra Tim Cook, chefe da empresa de informática: tráfico de crianças, nada menos, e participação na conspiração contra Trump. Então, eu tenho que não censurar o Twitter e agora colaborar com Elon Musk.
Por Rafapal 
@giroonabroad

Em 2017, Roth twittou que havia “NAZIS REAIS NA CASA BRANCA”. 

Em abril de 2022, Roth disse a um colega que seu objetivo “é promover mudanças no mundo”, motivo pelo qual decidiu não se tornar um acadêmico.

@TheTwitterFile
